import React from "react";
import ReactDOM from "react-dom";
import './index.css'
const name = "Prasad";
const img1 = "https://picsum.photos/200/300";
const img2 = "https://picsum.photos/300/300";
const img3 = "https://picsum.photos/400/300";
const img4 = "https://picsum.photos/500/300";
ReactDOM.render(
  <>
    <h1 class="heading">{`My name Is ${name}`}</h1>
    <img src={img1} alt="" />
    <img src={img2} alt="" />
    <img src={img3} alt="" />
    <a href="https://www.youtube.com" target="Prasad">
      <img src={img4} alt="Random Image" />
    </a>
  </>,
  document.getElementById("root")
);
